We have got the following problem in our application:

When the application is initially started, no scrollbars are displayd.
But when the user increases the size of the browser, the scrollbars will get activated.

This problem with the unnecessary scrollbars only shows up with the Safari-browser. This problem is reproducible with Safari 5 on Windows and with Safari on Mac.

This problem is reproducible with the attached demo application appearancedemo.zip.

